import React from 'react';

const GameItem = ({ id, name, image }) => {
  const imageUrl = image ? `https://api.adkey-seo.com/storage/images/games/${image}` : '';

  return (
    <div className='game-item' id={id}>
      <div className='game-name'>{name}</div>
      {imageUrl && <img src={imageUrl} alt="img" />}
    </div>
  );
};

export default GameItem;
